    finish_year=get_year(daydef[FinishDate])
    sc3.print(str(start_year), str(finish_year))
    if start_year !=finish_year:
        return True
    else:
        return False

def address_new_year():
    if check_new_year():
        sc3.ConstraintEnable('NominalMonth',False)
        sc3.ConstraintEnable('NewYearMonth')
        sc3.ConstraintEnable('NewYearMonth.OffDays',True,4) #If you define new level
